import React from 'react';
import icon from './images/neural.png';
import './Header.css';

function Header() {
  return (
    <div className="header">
      <CustomLink to="/home" className="link">Home</CustomLink>
      <img src={icon} />
      <h1>Introduction to Deep Learning</h1>
      <hr />
    </div>
  );
}
export default Header;
